import * as React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import TaskList from "../src/component/TasksList/TasksList";

const App = () => (
  <Router>
    <Routes>
      <Route exact path="/list" element={<TaskList />} />
    </Routes>
  </Router>
);

export default App;
